import { useState, useEffect, useCallback } from 'react';
import Alert from '@mui/material/Alert';
import Stack from '@mui/material/Stack';
import {
    TableCell,
    TableRow,
    Grid,
    Dialog,
    DialogTitle,
    DialogActions,
    DialogContent,
    Typography,
    Button,

    } from '@mui/material';
function Modals (Data) {
    const [opent, setOpent] = useState(false);
    const bitacora= () => {
        setOpent(true);
      };
      const bitacoraClose = () => {
        setOpent(false);
      };
    const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: 400,
        bgcolor: 'background.paper',
        border: '2px solid #000',
        boxShadow: 24,
        p: 4,
      };
    return(
        <>
            <div>
            <Button onClick={bitacora}  variant="contained"><span className='check'>></span>Continuar</Button>
            <Dialog
            maxWidth="md"
            open={opent}
            onClose={bitacoraClose}
            >
            <DialogTitle
            sx={{
            p: 3
            }}
            >
            <Typography variant="h5" gutterBottom>
            <label>Nombre Usuario: {Data.Data.nombre}</label>
            </Typography>
            </DialogTitle>
            <form>
            <DialogContent>
            <Grid item xs={12} md={12}>
            <tbody>
            <TableCell>{('Num documento')}</TableCell>
            <TableCell>{('Nombre')}</TableCell>
            <TableCell>{('Apellido')}</TableCell>
            <TableCell>{('Email')}</TableCell>
            <TableCell>{('Valor')}</TableCell>
            <TableCell>{('Fecha')}</TableCell>
            <TableCell>{('Descripcion')}</TableCell>
            <TableRow key={Data}>
            <TableCell>{Data.Data.nombre}</TableCell>
            <TableCell>{Data.Data.NumDoc}</TableCell>
            <TableCell>{Data.Data.apellido}</TableCell>
            <TableCell>{Data.Data.mail}</TableCell>
            <TableCell>{Data.Data.valor}</TableCell>
            <TableCell>{Data.Data.fecha}</TableCell>
            <TableCell>{Data.Data.descrip}</TableCell>
            </TableRow> 
            </tbody>
            </Grid>
            </DialogContent>
            <DialogActions
            sx={{
            p: 3
            }}
            >
            <Stack sx={{ width: '100%' }} spacing={2}>
            <Alert severity="error">This is an error alert — check it out!</Alert>
            <Alert severity="success">Transacción Exitosa¡!</Alert>
            </Stack>
            </DialogActions>
            </form>
            </Dialog>
        </div>
        </>
    )
}
export default Modals;
